import "./App.css";
import Navbar from "./components/Navbar";
import Gallery from "./pages/Gallery";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
  Routes,
} from "react-router-dom";
import Home from "./components/Home";

function App() {
  return (
    <>
      <BrowserRouter> 
        <Navbar />
        <Home />
        <Routes>
          <Route path="/gallery"><Gallery/></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
